import os
import sys
from PyQt5.QtWidgets import (
    QApplication, QWidget, QVBoxLayout, QLabel, QPushButton,
    QHBoxLayout, QSizePolicy, QMessageBox
)
from PyQt5.QtGui import QIcon, QFont, QPixmap, QPalette, QBrush
from PyQt5.QtCore import Qt, QSize
from base64 import b64decode
from io import BytesIO
from PIL import Image
from PyQt5.QtGui import QImage, QPixmap
import ctypes

class SILABox(QWidget):
    APPDATA_DIR = os.path.join(os.getenv('APPDATA'), 'SILA_Box')

    PROGRAMS = [
        {"name": "SILA VST Backup", "icon": "SILAVSTBackup.ico", "launch_cmd": "start SILAVSTBackup.exe"},
        {"name": "SILA KeyMap", "icon": "KeyMap.ico", "launch_cmd": "start SILAKeyMap.exe"},
        {"name": "SoundWIDI by SILA", "icon": "SoundWIDI.ico", "launch_cmd": "start SoundWIDIbySILA.exe"},
        {"name": "EQ-SILA", "icon": "EQ-SILAv1.1.ico", "launch_cmd": "start EQ-SILAv1.1.exe"},
        {"name": "SILA JackBay", "icon": "SJB.ico", "launch_cmd": "start SILAJackBay.exe"},
        {"name": "ExtenSILA", "icon": "ExtenSILA.ico", "launch_cmd": "start ExtenSILA.exe"},
        {"name": "SILA-GUI", "icon": "SILA.ico", "launch_cmd": "start SILA.exe"},
    ]

    def __init__(self):
        super().__init__()
        if not self.is_admin():
            QMessageBox.critical(self, "Error", "Este programa debe ejecutarse como administrador.")
            sys.exit()
        self.setup_ui()
        self.create_appdata_directory()

    def setup_ui(self):
        """Configure the user interface."""
        self.setWindowTitle("Studio Instrument Launch Assistant Box")
        self.setFixedSize(810, 670)
        self.setWindowIcon(self.get_icon_from_base64())
        self.set_background_image()

        main_layout = QVBoxLayout(self)
        main_layout.addWidget(self.create_section_title("Install Audacity:", "#FFD700"))
        main_layout.addLayout(self.create_install_buttons())
        main_layout.addWidget(self.create_section_title("Run a SILA software:", "#FFD700"))
        main_layout.addLayout(self.create_program_buttons())
        main_layout.addWidget(self.create_developer_info())
        self.setLayout(main_layout)

    def create_appdata_directory(self):
        """Create the AppData directory if it doesn't exist."""
        os.makedirs(self.APPDATA_DIR, exist_ok=True)

    def set_background_image(self):
        """Set the background image for the window."""
        background_pixmap = QPixmap(self.resource_path("BGSILABox.png"))
        palette = QPalette()
        palette.setBrush(QPalette.Window, QBrush(background_pixmap))
        self.setPalette(palette)

    def create_section_title(self, text, color):
        """Create a section title label."""
        title = QLabel(text)
        title.setFont(QFont('Arial', 22, QFont.Bold))
        title.setStyleSheet(f"color: {color}; margin-bottom: 20px;")
        title.setAlignment(Qt.AlignCenter)
        return title

    def create_program_buttons(self):
        """Create buttons for launching programs."""
        buttons_layout = QVBoxLayout()

        for i in range(0, len(self.PROGRAMS), 2):
            row_layout = QHBoxLayout()
            for j in range(2):
                if i + j < len(self.PROGRAMS):
                    button = self.create_program_button(self.PROGRAMS[i + j])
                    row_layout.addWidget(button)
            buttons_layout.addLayout(row_layout)

        return buttons_layout

    def create_program_button(self, program):
        """Create a button for a specific program."""
        button = QPushButton()
        button.setFont(QFont('Arial', 13, QFont.Bold))
        icon_path = self.resource_path(program["icon"])
        
        if os.path.exists(icon_path):
            button.setIcon(QIcon(icon_path))
        else:
            print(f"Icon not found: {icon_path}")
            button.setIcon(QIcon())  # Si no se encuentra el ícono, asignar un ícono vacío

        button.setIconSize(QSize(90, 90))  # Tamaño de ícono ajustado
        button.setText(f' {program["name"]}')
        button.setStyleSheet(self.get_launch_button_style())
        button.clicked.connect(lambda: self.launch_program(program["launch_cmd"]))
        button.setSizePolicy(QSizePolicy.Expanding, QSizePolicy.Fixed)
        return button

    def get_launch_button_style(self):
        """Return the stylesheet for the launch program buttons."""
        return """
            QPushButton {
                background-color: #404040; 
                color: #FFD700; 
                border: 2px solid #FFD700; 
                border-radius: 10px;
                padding: 10px;
                text-align: left;
            }
            QPushButton:hover {
                background-color: #FF4500; 
                color: white;  
            }
        """

    def create_install_buttons(self):
        """Create buttons for installing additional tools."""
        install_layout = QVBoxLayout()

        musehub_button = QPushButton("Install Audacity")
        musehub_button.setFont(QFont('Arial', 16, QFont.Bold))
        musehub_button.setStyleSheet(self.get_launch_button_style())
        musehub_button.clicked.connect(lambda: self.install_program("audacity-win-3.7.1-64bit.exe"))
        install_layout.addWidget(musehub_button)

        return install_layout

    def create_developer_info(self):
        """Create a label with developer information."""
        dev_info = QLabel("Dev. Iván Ayub | sellocasadenubes@gmail.com")
        dev_info.setFont(QFont('Arial', 16))
        dev_info.setStyleSheet("color: #FFD700; margin-top: 20px;")
        dev_info.setAlignment(Qt.AlignCenter)
        return dev_info

    def install_program(self, installer_name):
        """Run the installer for an additional tool."""
        installer_path = self.resource_path(installer_name)
        if os.path.exists(installer_path):
            try:
                os.startfile(installer_path)  # Ejecuta el instalador
                self.show_message("Installation", f"{installer_name} installation started.")
            except Exception as e:
                self.show_message("Error", f"Failed to launch installer: {str(e)}")
        else:
            self.show_message("File Not Found", f"Installer not found: {installer_name}")

    def launch_program(self, launch_command):
        """Launch the selected program."""
        try:
            result = os.system(launch_command)
            if result != 0:
                self.show_message("Launch Error", f"Failed to launch the program:\n{launch_command}")
            else:
                self.show_message("Success", "Program launched successfully!")
        except Exception as e:
            self.show_message("Error", f"An error occurred: {str(e)}")

    def show_message(self, title, message):
        """Display a message box with the given title and message."""
        msg_box = QMessageBox()
        msg_box.setWindowTitle(title)
        msg_box.setText(message)
        msg_box.setStandardButtons(QMessageBox.Ok)
        msg_box.exec_()

    def resource_path(self, relative_path):
        """Get the absolute path to the resource directory."""
        base_path = os.path.dirname(os.path.abspath(sys.argv[0]))
        return os.path.join(base_path, "resources", relative_path)

    def get_icon_from_base64(self):
        """Convert base64 image data to QIcon."""
        base64_data = ""  # Replace with your base64 string
        image_data = b64decode(base64_data)
        image = Image.open(BytesIO(image_data))
        qimage = QImage(image.tobytes(), image.width, image.height, QImage.Format_RGBA8888)
        pixmap = QPixmap.fromImage(qimage)
        return QIcon(pixmap)

    @staticmethod
    def is_admin():
        """Check if the program is running as administrator."""
        try:
            return ctypes.windll.shell32.IsUserAnAdmin()
        except:
            return False

def main():
    app = QApplication(sys.argv)
    sila_box = SILABox()
    sila_box.show()
    sys.exit(app.exec_())

if __name__ == '__main__':
    main()
